import React from "react";

function NavBar(){
    return (
      <ul class="nav">
  <li class="nav-item">
    <a class="nav-link active" aria-current="page" href="/add">Add Supplier</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="/added">Add Material</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="/adding">Add Intentory Item</a>
  </li>
  <li class="nav-item">
    <a class="nav-link disabled">Disabled</a>
  </li>
</ul>

    )
}

export default NavBar;
